css:
@-moz-document domain("www.youtube.com") {
span.logo-red.yt-sprite {
	width: 73px !important;
}

span.logo-red.yt-sprite:after {
    content: " ";
    display: inline-block;
    background: no-repeat url(https://s.ytimg.com/yts/imgbin/www-hitchhiker-vflNlthLq.webp) -642px -75px;
    background-size: auto;
    width: 30px;
    height: 30px;
    background-color: white;
}
}
